    "station_info": {                                "en": "If you leave the station empty, then the nearest station according to the give location is picked automatically. If you are not happy with this choice you can insert here the station code of your preferred station (e.g. \"IAARGAUB5\"). You can find these codes e.g. on the <a target=\"blank\" href=\"http://www.wunderground.com/wundermap\">Wundermap</a> - click a station and look for the \"Station ID\"", "de": "Wenn Sie die Station leer lassen, wird automatisch der nächstgelegene Bahnhof entsprechend der angegebenen Position ausgewählt. Wenn Sie mit dieser Auswahl nicht zufrieden sind, können Sie hier den Sendercode Ihrer bevorzugten Station (z. B. \"IAARGAUB5\") eingeben. Sie können diese Codes z.B. Auf der <a target=\"blank\" href=\"http://www.wunderground.com/wundermap\"> Wundermap </a> - klicke auf eine Station und suche nach der \"Station ID\"", "ru": "Если вы оставите станцию ​​пустой, то ближайшая станция в соответствии с местоположением выбора будет выбрана автоматически. Если вас не устраивает этот выбор, вы можете вставить здесь код станции вашей предпочтительной станции (например, «IAARGAUB5»). Вы можете найти эти коды, например. на <a target=\"blank\" href=\"http://www.wunderground.com/wundermap\"> Wundermap </a> - щелкните по станции и найдите «Идентификатор станции»,", "pt": "Se você deixar a estação vazia, a estação mais próxima, de acordo com a localização da oferta, será selecionada automaticamente. Se não estiver satisfeito com esta opção, pode introduzir aqui o código da estação da sua estação preferida (por exemplo, \"IAARGAUB5\"). Você pode encontrar esses códigos, por exemplo no <a target=\"blank\" href=\"http://www.wunderground.com/wundermap\"> Wundermap </a> - clique em uma estação e procure a \"ID da estação\"", "nl": "Als u het station leeg laat, wordt het dichtstbijzijnde station op basis van de locatie van de locatie automatisch geselecteerd. Als u niet tevreden bent met deze keuze, kunt u hier de stationscode van uw voorkeursstation invoegen (bijvoorbeeld 'IAARGAUB5'). Je kunt deze codes vinden b.v. op de <a target=\"blank\" href=\"http://www.wunderground.com/wundermap\"> Wundermap </a> - klik op een station en zoek naar de \"Station-ID\"", "fr": "Si vous laissez la station vide, la station la plus proche est automatiquement sélectionnée. Si vous n'êtes pas satisfait de ce choix, vous pouvez insérer ici le code de station de votre station préférée (par exemple \"IAARGAUB5\"). Vous pouvez trouver ces codes par ex. sur le <a target=\"blank\" href=\"http://www.wunderground.com/wundermap\"> Wundermap </a> - cliquez sur une station et cherchez le \"Station ID\"", "it": "Se lasci la stazione vuota, la stazione più vicina in base alla posizione di assegnazione viene selezionata automaticamente. Se non sei soddisfatto di questa scelta, puoi inserire qui il codice della stazione della tua stazione preferita (ad esempio \"IAARGAUB5\"). Puoi trovare questi codici, ad es. nella <a target=\"blank\" href=\"http://www.wunderground.com/wundermap\"> Wundermap </a> - fai clic su una stazione e cerca \"ID stazione\"", "es": "Si deja la estación vacía, entonces la estación más cercana según la ubicación de entrega se selecciona automáticamente. Si no está satisfecho con esta opción, puede insertar aquí el código de estación de su estación preferida (por ejemplo, \"IAARGAUB5\"). Puede encontrar estos códigos, p. en el <a target=\"blank\" href=\"http://www.wunderground.com/wundermap\"> Wundermap </a> - haga clic en una estación y busque la \"ID de la estación\"", "pl": "Jeśli zostawisz stację pustą, wtedy najbliższa stacja zgodnie z położeniem podaj jest wybierana automatycznie. Jeśli nie jesteś zadowolony z tego wyboru, możesz wstawić kod stacji wybranej stacji (np. \"IAARGAUB5\"). Możesz znaleźć te kody, np. na <a target=\"blank\" href=\"http://www.wunderground.com/wundermap\"> Wundermap </a> - kliknij stację i znajdź \"Identyfikator stacji\""},
